//5,10,15,20,25,30,35,40,45,50을 출력하는 프로그램을 만들어라 (for 사용)
public class number4 {
	public static void main(String[] args) {
		// TODO Auto-generated method stub
	
		for(int i=5; i<=50; i+=5)
		{
			System.out.print(i+" ");
		}
		
		// 콤마 넣고 싶을 때 5,10,15.. if문으로 마지막 숫자 전까지만 ,추가하기
		
	}
	
}
